import { css } from '@emotion/core';
import { GoArrowUp } from "react-icons/go";

const style = css`
  fill: #838383;
`;

function Vote(props) {
  return (
    <>
      <GoArrowUp css={style} />
    </>
  );
}

export default Vote;
